import React from 'react'
import { Route, Switch, Redirect } from 'react-router-dom'


export default function PrivateRoute({component:Component
    , ...restProps}) {

        const user = {name : 'haris'};
    return (


       <Route 
       {...restProps}

       render={props => {
            return user ? 
            <Component {...props} />
            :
            <Redirect to={{
                pathname:"/login"
            }} />
       }}

       />
    );
}
